      value={props.value}
      name="filter"
      type="text"
      className="form-control"
      placeholder="City name"
      id="filter"
    />

    <button onClick={props.handleFormSubmit} className="btn btn-primary">
      Filter Table
    </button>
  </div>
</form> 
